INSERT INTO "Question__c" VALUES(273,'True','','','','','','','','2022-06-13T15:18:35.000+0000','False','','','','','','False','True','','False','','','','','','','False','','2022-07-06T13:52:57.000+0000','','','','Link to UG Apps (UGFR)','Name','False','','','','Question__c2022-06-13 15:17:13Z00000','','012R0000003IU9WIAW','','','','','<p>You are applying to the University of St. Thomas as an <strong>Undergraduate First-Year </strong>applicant.</p><p><br></p><p class="ql-indent-1"><em style="font-size: 12px;">You should apply as a transfer student if you have completed high school or you have received a GED </em><strong style="font-size: 12px;"><em>AND</em></strong><em style="font-size: 12px;"> you have enrolled as a degree-seeking college student in a fall or spring term.Click here to go to the </em><a href="https://easyappdev-uofstthomasmn.cs2.force.com/admissions/ApplicationRegistration?at=UGTR" target="_blank" style="font-size: 12px;"><em> Undergraduate Transfer application.</em></a></p><p class="ql-indent-1"><br></p><p class="ql-indent-1"><em style="font-size: 12px;">Dougherty Family College offers a two-year associate degree designed to propel students towards success and provide a smooth transition to a four-year college. Click here if you would like to apply to the </em><a href="https://easyappdev-uofstthomasmn.cs2.force.com/admissions/ApplicationRegistration?at=DFC" target="_blank" style="font-size: 12px;"><em> Dougherty Family College application. </em></a></p><p><br></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);">Click next to create your password and create your application.</span></p>','','','','48');
