INSERT INTO "Question__c" VALUES(275,'True','','','','Started App;Submitted App','','','','2022-06-10T17:43:53.000+0000','False','','','','','0.0','False','True','Started App','False','','','','','','','False','Test Score Submission Preference','2022-07-01T19:53:28.000+0000','','','','Test Score Preference Static Text (UGFR)','Name','False','','','','Question__c2022-05-12 22:29:41Z00000','','012R0000003IU9WIAW','','Started App','','','<p>Students can choose to apply with a standardized test or without. Please let us know if you want test scores to be reviewed as part of your admission application. Wondering which option to choose? View our <a href="https://www.stthomas.edu/admissions/undergraduate/freshman/test-optional/" target="_blank"> test optional website </a> to learn more about our test-optional policies.</p><p><br></p><p>Note: If you have not yet taken the ACT or SAT, but intend to take it and send it as part of your application, select Apply With Standardized Test.</p>','','','','39');
